import React from "react";

const ItsOverNineThousand = ({ result, setResult }) => {
	const rendering = () => {
		if (setResult(eval(result).toString())) {
			return <h2>Yahou</h2>;
		}
	};
	return <div>{rendering}</div>;
};

export default ItsOverNineThousand;
